import React from 'react'
import styled from 'styled-components'

function Cartt() {
  return (
    <Container>
        <Image>
        <img src="https://m.media-amazon.com/images/W/IMAGERENDERING_521856-T1/images/I/413jhqxM45L._SX300_SY300_QL70_FMwebp_.jpg" alt="" />
        </Image>
        <Discription>
        <h3>Mielle Organics Rosemary Mint Scalp & Hair Strengthening Oil With Biotin & Essential Oils, Nourishing Treatment for Split Ends and Dry Scalp for All Hair Types, 2-Fluid Ounces</h3>
        </Discription>
    </Container>
  )
}

const Container = styled.div`
    width:100%;
    height:100%;
    display:flex;
    flex-direction:column;
    background-color:#fff;
    z-index:10;
    border:1px solid red;
`;

const Image =styled.div`
    width:100%;

    display:flex;
    flex-direction:column;
    justify-content:center;
    align-items:center;
    margin-top:20px;

    img{
        width:180px;
        height:200px;
    }
`;

const Discription =styled.div`

`;
export default Cartt
